In 1906, Tom Richards, a drifter, arrives in Plattsville and befriends newspaper
proprietor Vinnie McLeod, who is battling the corruption of the town's leading
citizen Bill Dougherty. He takes over as managing editor of the Plattsville
&quot;Shield and Banner&quot; and, despite initial resistance from the oppressed citizens,
finally drives Dougherty out of town.

